import React, {Component} from 'react';
import Photo from './Photo';

function PhotoWall(props){
    return(
        <div class="photoGrid">
            {props.posts.map((post, index) => <Photo key={index} post={post}/>)}
        </div>
    )
}

export default PhotoWall;
